// import {useState} from "react";
import './App.css';


const Person = (props) => {
  return (<>

  <h1> name: {props.name} </h1>
  <h2>last: {props.last}</h2>
  <h1>age: {props.age}</h1>

  </>)
};

const App = () => {
  return (
    <div className="App">

      <Person name = {"anwar"}/>
    </div>


  );
}

export default App;
